import React from 'react';
import MathEquationDisplay from '../components/MathEquationDisplay';

const App = () => {
  const equation = "\\frac{3}{4} \\times x^2 + 5 = 10";

  return (
    <div>
      <h1>Math Equation Display</h1>
      <MathEquationDisplay equation={equation} displayMode={true} />
    </div>
  );
};

export default App;
